                <input type="text"
                    placeholder='Imie'/>

                <input type="text"
                    placeholder='Opis'/>

                <input type="text"
                    placeholder='Email'/>

                <input type="text"
                    placeholder='Tagi'/>

            </form>
        )
    }
}
